%[text] # Backtest Strategies Using Deep Learning
%[text] Construct trading strategies using a deep learning model and then backtest the strategies using the Financial Toolbox™ backtesting framework. The example uses Deep Learning Toolbox™ to train a predictive model from a set of time series and demonstrates the steps necessary to convert the model output into trading signals. It builds a variety of trading strategies that backtest the signal data over a 5-year period.
%[text] This example illustrates the following workflow:
%[text] 1. [Load price data for a set of energy commodities](internal:H_32ED5737).
%[text] 2. [Clean and trim data](internal:H_EE58EFDD).
%[text] 3. [Use the historical data to train a long short-term memory (LSTM) network to predict the change in energy prices over the next trading day](internal:H_6A1AA300).
%[text] 4. [Use the LSTM network to build a timetable of trading signal data for the backtest engine](internal:H_C2557645).
%[text] 5. [Construct trading strategies that allocate capital based on the trading signals](internal:H_80C7F9B2).
%[text] 6. [Backtest the strategies using the backtesting framework](internal:H_FEC5B540).
%[text] 7. [Examine the backtest results](internal:H_3D9307B9). \
%[text] The focus of this example is on the workflow from data, to a trained model, to trading strategies, and finally to a backtest of the strategies. The deep learning model, its output, the subsequent trading signals, and the strategies are fictional. The intent is only to show the steps for developing and deploying this type of model.
%%
%[text] %[text:anchor:H_32ED5737] ## Load Data
%[text] Load the historical price data. This data set contains daily spot prices for 12 different energy products ranging from 1986 to 2021 and consists of the following time series:
%[text] - WTI — West Texas Intermediate light crude oil
%[text] - Brent — Brent light crude oil
%[text] - NaturalGas — Henry Hub natural gas
%[text] - Propane — Mon Belvieu propane
%[text] - Kerosene — US Gulf Coast kerosene-type jet fuel
%[text] - HeatingOil — New York Harbor no. 2 heating oil
%[text] - GulfRegular — US Gulf Coast conventional gasoline
%[text] - LARegular — Los Angeles reformulated RBOB regular gasoline
%[text] - NYRegular — New York Harbor conventional gasoline
%[text] - GulfDiesel — US Gulf Coast ultra-low sulfur no. 2 diesel
%[text] - LADiesel — Los Angeles ultra-low sulfur CARB diesel
%[text] - NYDiesel — New York Harbor ultra-low sulfur no. 2 diesel \
%[text] The source of this data is the US Energy Information Administration (Nov 2021).
priceData = load('energyPrices.mat','energyPrices');
priceData = priceData.energyPrices;
tail(priceData) %[output:77b82f21]
%%
%[text] %[text:anchor:H_EE58EFDD] ## Clean and Trim Data
%[text] The price datasets do not all start at the same time. Some datasets start later than others and have fewer data points. The following plot shows the time span for each price series.
seriesLifespanPlot(priceData) %[output:9343b4e7]
%[text] To avoid large spans of missing data, remove the series with shorter histories.
priceData = removevars(priceData,["NYDiesel","GulfDiesel","LARegular"]);
%[text] The remaining table variables contain sporadic missing elements (`NaN`s) due to holidays or other reasons. Missing data is handled in a variety of ways depending on the dataset. In some cases, it may be appropriate to interpolate or use the [fillmissing](docid:matlab_ref.bva1z1c) function. In this example, you can remove the remaining `NaN` prices.
priceData = rmmissing(priceData);
%[text] Then, convert the price data to a return series using the [tick2ret](docid:finance_ug.f5-738332) function. The final dataset consists of nine price series with daily data from 1997 through 2021.
returnData = tick2ret(priceData) %[output:5bc9de38]
%%
%[text] %[text:anchor:H_6A1AA300] ## Prepare Data for Training LSTM Model
%[text] Prepare and partition the dataset in order to train the LSTM model. The model uses a 30-day rolling window of trailing feature data and predicts the next day price changes for four of the assets: Brent crude oil, natural gas, propane, and kerosene.
% Model is trained using a 30-day rolling window to predict 1 day in the
% future.
historySize = 30;
futureSize = 1;

% Model predicts returns for oil, natural gas, propane, and kerosene.
outputVarName = ["Brent" "NaturalGas", "Propane" "Kerosene"];
numOutputs = numel(outputVarName);

% start_idx and end_idx are the index positions in the returnData
% timetable corresponding to the first and last date for making a prediction.
start_idx = historySize + 1;
end_idx   = height(returnData) - futureSize + 1;
numSamples = end_idx - start_idx + 1;

% The date_vector variable stores the dates for making predictions.
date_vector = returnData.Time(start_idx-1:end_idx-1);
%[text] Convert the `returnData` timetable to a `numSamples`-by-`1` cell array. Each cell contains a `numFeatures`-by-`seqLength` matrix.  The response variable is a `numSamples`-by-`numResponses` matrix.
network_features  = cell(numSamples,1);
network_responses = zeros(numSamples,numOutputs);

for j = 1:numSamples
    network_features{j} = (returnData(j:j+historySize-1,:).Variables)';
    network_responses(j,:) = ...
        (returnData(j+historySize:j+historySize+futureSize-1,outputVarName).Variables)';
end
%%
%[text] Split the `network_features` and the `network_responses` into three parts: training, validation, and backtesting. Select the backtesting set as a set of sequential data points. The remainder of the data is randomly split into a training and a validation set.  Use the validation set to prevent overfitting while training the model. The backtesting set is not used in the training process, but it is reserved for the final strategy backtest.
% Specify rows to use in the backtest (31-Dec-2015 to 2-Nov-2021).
backtest_start_idx = find(date_vector < datetime(2016,1,1),1,'last');
backtest_indices = backtest_start_idx:size(network_responses,1);

% Specify data reserved for the backtest.
Xbacktest = network_features(backtest_indices);
Tbacktest = network_responses(backtest_indices,:);

% Remove the backtest data.
network_features = network_features(1:backtest_indices(1)-1);
network_responses = network_responses(1:backtest_indices(1)-1,:);

% Partition the remaining data into training and validation sets.
rng('default');
cv_partition = cvpartition(size(network_features,1),'HoldOut',0.2);

% Training set
Xtraining = network_features(~cv_partition.test,:);
Ttraining = network_responses(~cv_partition.test,:);

% Validation set
Xvalidation = network_features(cv_partition.test,:);
Tvalidation = network_responses(cv_partition.test,:);
%%
%[text] ## Define LSTM Network Architecture
%[text] Specify the network architecture as a series of layers. For more information on LSTM networks, see [Long Short-Term Memory Networks](docid:nnet_ug#mw_b9c3c9b2-62d9-47fa-8105-0e940fb4ac08). The [Deep Network Designer App](docid:nnet_ref.mw_301a3a9d-998a-4668-aec4-f94646b76921) is a powerful tool for designing deep learning models.
numFeatures = width(returnData);
numHiddenUnits_LSTM = 10;

layers_LSTM = [ ...
    sequenceInputLayer(numFeatures) 
    lstmLayer(numHiddenUnits_LSTM)
    layerNormalizationLayer
    lstmLayer(numHiddenUnits_LSTM)
    layerNormalizationLayer
    lstmLayer(numHiddenUnits_LSTM,'OutputMode','last')
    layerNormalizationLayer
    fullyConnectedLayer(numOutputs)];
%%
%[text] ## Specify Training Options for LSTM Model
%[text] Next, you specify training options using the [trainingOptions](docid:nnet_ref.bu59f0q) function. Many training options are available and their use varies depending on your use case. Use the [Experiment Manager App](docid:nnet_ref.mw_11ce840f-eed7-4975-9c28-baeebd79f092) to explore different network architectures and sets of network hyperparameters.
max_epochs = 500;
mini_batch_size = 128;
learning_rate = 1e-4;

options_LSTM = trainingOptions('adam', ...
    'InputDataFormats',"CTB",...
    'Plots','training-progress', ...
    'Verbose',0, ...
    'MaxEpochs',max_epochs, ...
    'MiniBatchSize',mini_batch_size, ...
    'Shuffle','every-epoch', ...
    'ValidationData',{Xvalidation,Tvalidation}, ...
    'ValidationFrequency',50, ...
    'ValidationPatience',10, ...
    'InitialLearnRate',learning_rate, ...
    'GradientThreshold',1);
%%
%[text] ## Train LSTM Model
%[text] Train the LSTM network. Use the [trainNetwork](docid:nnet_ref.bu6sn4c) function to train the network until the network meets a stopping criteria. This process can take several minutes depending on the computer running the example. For more information on increasing the network training performance, see [Scale Up Deep Learning in Parallel, on GPUs, and in the Cloud](docid:nnet_ug.mw_1b413c3b-4be3-4913-b405-b33d188fd863).
%[text] To avoid waiting for the network training, load the pretrained network by setting the `doTrain` flag to `false`. To train the network using [trainNetwork](docid:nnet_ref.bu6sn4c), set the `doTrain` flag to `true`.
doTrain = false;

if doTrain
    % Train the LSTM network.
    net_LSTM = trainnet(Xtraining,Ttraining,layers_LSTM,"mse",options_LSTM);
else
    % Load the pretrained network.
    load lstmBacktestNetwork
end
%%
%[text] ## Visualize Training Results
%[text] Visualize the results of the trained model by comparing the predicted values against the actual values from the validation set.
% Compare the actual returns to model predicted returns.
actual    = Tvalidation;
predicted = minibatchpredict(net_LSTM,Xvalidation,InputDataFormats="CTB");
%%
% Overlay histogram of actual vs. predicted returns for the validation set.
output_idx = 1; %[control:dropdown:510e]{"position":[14,15]}
figure; %[output:99403e38]

[~,edges] = histcounts(actual(:,output_idx),100);
histogram(actual(:,output_idx),edges); %[output:99403e38]
hold on %[output:99403e38]
histogram(predicted(:,output_idx),edges) %[output:99403e38]
hold off %[output:99403e38]
xlabel('Percentage Change in Closing Price') %[output:99403e38]
legend('Actual','Predicted') %[output:99403e38]
title(sprintf('%s: Distribution of Returns, Actual vs. Predicted', outputVarName(output_idx))) %[output:99403e38]
% Display the predicted vs. actual daily returns for the validation set.
figure %[output:650c0461]
plot(actual(:,output_idx)) %[output:650c0461]
hold on %[output:650c0461]
plot(predicted(:,output_idx)) %[output:650c0461]
yline(0) %[output:650c0461]
legend({'Actual','Predicted'}) %[output:650c0461]
title(sprintf('%s: Daily Returns, Actual vs. Predicted', outputVarName(output_idx))) %[output:650c0461]
% Examine the residuals.
residuals = actual(:,output_idx) - predicted(:,output_idx);
figure; %[output:077e0113]
normplot(residuals); %[output:077e0113]
%[text] The actual data has fatter tails than the trained model predictions. The model predictions are not accurate, but the goal of this example is to show the workflow from loading data, to model development, to backtesting. A more sophisticated model with a larger and more varied set of training data is likely to have more predictive power.
%%
%[text] %[text:anchor:H_C2557645] ## Prepare Backtest Data
%[text] Use the predictions from the LSTM model to build the backtest strategies. You can post-process the model output in a number of ways to create trading signals. However, for this example, take the model regression output and convert it to a timetable.
%[text] Use [predict](docid:nnet_ref.function_dlnetwork.predict) with the trained network to generate model predictions over the backtest period.
backtestPred_LSTM = minibatchpredict(net_LSTM,Xbacktest,InputDataFormats="CTB");
%[text] Convert the predictions to a trading signal timetable.
backtestSignalTT = timetable(date_vector(backtest_indices),backtestPred_LSTM);
%[text] Construct the prices timetable corresponding to the backtest time span. The backtest trades in and out of the four energy commodities. The prices timetable has the closing price for the day on which the prediction is made.
backtestPriceTT = priceData(date_vector(backtest_indices),outputVarName);
%[text] Set the risk-free rate to be 1% annualized. The backtest engine also supports setting the risk-free rate to a timetable containing the historical daily rates.
risk_free_rate = 0.01;
%%
%[text] %[text:anchor:H_80C7F9B2] ## Create Backtest Strategies
%[text] Use [backtestStrategy](docid:finance_ug.object_backtest_strategy) to create four trading strategies based on the signal indicators. The following trading strategies are intended as examples to show how to convert the trading signals into actionable asset allocation strategies that you can then backtest:
%[text] - Long Only — Invest all capital across the assets with positive predicted return, proportional to their signal strength (predicted return).
%[text] - Long Short — Invest capital across the assets, both long and short positions, proportional to their signal strength.
%[text] - Best Bet — Invest all capital into the single asset with the highest predicted return.
%[text] - Equal Weight — Rebalance each day to equal-weighted allocation. \
% Specify 10 basis points as the trading cost.
tradingCosts = 0.001;

% Invest in long positions proportionally to their predicted return.
LongStrategy = backtestStrategy('LongOnly',@LongOnlyRebalanceFcn, ...
    'TransactionCosts',tradingCosts, ...
    'LookbackWindow',1);

% Invest in both long and short positions proportionally to their predicted returns.
LongShortStrategy = backtestStrategy('LongShort',@LongShortRebalanceFcn, ...
    'TransactionCosts',tradingCosts, ...
    'LookbackWindow',1);

% Invest 100% of capital into single asset with highest predicted returns.
BestBetStrategy = backtestStrategy('BestBet',@BestBetRebalanceFcn, ...
    'TransactionCosts',tradingCosts, ...
    'LookbackWindow',1);

% For comparison, invest in an equal-weighted (buy low and sell high) strategy.
equalWeightFcn = @(current_weights,prices,signal) ones(size(current_weights)) / numel(current_weights);
EqualWeightStrategy = backtestStrategy('EqualWeight',equalWeightFcn, ...
    'TransactionCosts',tradingCosts, ...
    'LookbackWindow',0);
%[text] Put the `strategies` into an array and then use [backtestEngine](docid:finance_ug.object_backtest_engine) to create the backtesting engine.
strategies = [LongStrategy LongShortStrategy BestBetStrategy EqualWeightStrategy];

bt = backtestEngine(strategies,'RiskFreeRate',risk_free_rate);
%%
%[text] %[text:anchor:H_FEC5B540] ## Run Backtest
%[text] Use [runBacktest](docid:finance_ug.function_runbacktest) to backtest the strategies over the backtest range.
bt = runBacktest(bt,backtestPriceTT,backtestSignalTT) %[output:9d2a2e07]
%%
%[text] %[text:anchor:H_3D9307B9] ## Examine Backtest Results
%[text] Use the [summary](docid:finance_ug.function_backtestsummary) and [equityCurve](docid:finance_ug.function_equitycurve) functions to summarize and plot the backtest results. This model and its derivative trading strategies are not expected to be profitable in a realistic trading scenario. However, this example illustrates a workflow that should be useful for practitioners with more comprehensive data sets and more sophisticated models and strategies.
summary(bt) %[output:3033a4c1]
figure; %[output:32d93213]
equityCurve(bt) %[output:32d93213]
%%
%[text] ## Local Functions
function new_weights = LongOnlyRebalanceFcn(current_weights,pricesTT,signalTT)  
% Long only strategy, in proportion to the signal.

signal = signalTT.backtestPred_LSTM(end,:);

if any(0 < signal)
    signal(signal < 0) = 0;
    new_weights = signal / sum(signal);
else
    new_weights = zeros(size(current_weights));
end

end


function new_weights = LongShortRebalanceFcn(current_weights,pricesTT,signalTT) %#ok<INUSD> 
% Long/Short strategy, in proportion to the signal

signal = signalTT.backtestPred_LSTM(end,:);
abssum = sum(abs(signal));

if 0 < abssum
    new_weights = signal / abssum;
else
    new_weights = zeros(size(current_weights));
end

end


function new_weights = BestBetRebalanceFcn(current_weights,pricesTT,signalTT) %#ok<INUSD> 
% Best bet strategy, invest in the asset with the most upside.

signal = signalTT.backtestPred_LSTM(end,:);
new_weights = zeros(size(current_weights));
new_weights(signal == max(signal)) = 1;

end


function seriesLifespanPlot(priceData)
% Plot the lifespan of each time series.

% Specify all time series end on same day.
d2 = numel(priceData.Time);

% Plot the lifespan patch for each series.
numSeries = size(priceData,2);
for i = 1:numSeries
    % Find start date index.
    d1 = find(~isnan(priceData{:,i}),1,'first');
    % Plot patch.
    x = [d1 d1 d2 d2];
    y = i + [-0.4 0.4 0.4 -0.4];
    patch(x,y,[0 0.4470 0.7410])

    hold on
end
hold off

% Set the plot properties.
xlim([-100 d2]);
ylim([0.2 numSeries + 0.8]);

yticks(1:numSeries);
yticklabels(priceData.Properties.VariableNames');
flipud(gca);

years = 1990:5:2021;
xtick_idx = zeros(size(years));
for yidx = 1:numel(years)
    xtick_idx(yidx) = find(years(yidx) == year(priceData.Time),1,'first');
end
xticks(xtick_idx);
xticklabels(string(years));

title('Time Series Life Span');

end
